from scipy.stats import norm

def skewNormal(x, alpha):
    """
    Compute the skew-normal distribution.

    Parameters:
    x (array_like): Values at which to evaluate the skew-normal distribution.
    alpha (float): Skewness parameter. Positive values skew right, negative values skew left.

    Returns:
    array_like: Skew-normal distribution evaluated at x.
    """
    return 2 * norm.pdf(x) * norm.cdf(alpha * x)

